sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code.toString() === "200") {
        var content = JSON.parse(inputs.response_body);
        var loc = content.loc.split(", ");

        outputs.hostname = content.hostname;
        outputs.city = content.city;
        outputs.region = content.region;
        outputs.country = content.country;
        outputs.latitude = loc[0];
        outputs.longitude = loc[1];
    }
})(inputs, outputs);

